import "./App.css";
import Axios from "axios";

Axios.post(`${process.env.REACT_APP_SERVER_URL}/fetch-and-scrape`)
  .then((response) => {
    console.log(response.data.html);
  })
  .catch((error) => console.log(error));

function App() {
  return (
    <div className="App">
      <div className="styled-masthead css-xwvrp9w e12sucsj1">
        <header data-test-id="Masthead" className="ds-masthead">
          <div className="ds-layout-masthead">
            <a href="/">
              <img id="ds-economist-logo" className="ds-masthead-logo" alt="" />
            </a>
          </div>
        </header>
      </div>
    </div>
  );
}

export default App;
